import React, { useState } from 'react';

const App = () => {

    const [time, setTime] = useState(new Date().toLocaleTimeString());

    return (
        <>
            <div className="container">
                <h1>{time}</h1>
                <button>Get Time</button>
            </div>
        </>
    );
}

export default App;
